message:
Added ClientIdRequestInterceptor;
Moved BasicAuthenticationRequestInterceptor to restclient package;
RestClientFactory can now create LeaseResource clients

Fixed some warnings in LocationViewModel;
LocationViewModel no longer inherits from ShoppingListViewModel;
LocationViewModel now uses LocationManager to retrieve LastLocation instances for places

Cleaned up initialization of ListStorageFragment (which is no longer a real fragment) and removed the need to provide a Activity upon initialization (Context will suffice);
Dagger module now makes sure that ListStorageFragment.SetupLocalListStorageFragment() is called before accessing it;
Moved most provider methods to KwikShopBaseModule (everything that does not depend on activity);
Added KwikShopBackgroundModule which can be created without providing an activity (necessary for SyncAdapter);
Removed dependencies on Activity and replaced it with Context where possible;

Added composite synchronizer (synchronizes both shopping lists and recipes);
Moved posting of synchronization events to CompositeSynchronizer;
Added message fields to SynchronizationEvent;
Added synchronization event for progress to deliver messages about the current synchronization step between start and completion;

Fixed saving of calendar entries for shopping lists to the database;
Changed behaviour for calendar events: If there is no data set, the event will be null instead of a event with id -1;
CalendarEventDate now uses separate fields for the internal id (used by ormlite) and the id of the event in the android calendar

Renamed DefaultUnitsProvider to DefaultDataProvider;
Added a default set of groups;
Made groups localizable;

Add more sample shopping list items (with other properties like comment, brand and amount);
Update shopping list style to match material design;
Display more item properties in shopping list;
